    false,nt"url": null,nt"notes": "NODC Accession 0100217 includes chemical,
    meteorological, physical and time series data collected from MOORINGS in the South
    Atlantic Ocean from 2006-06-08 to 2012-04-10. These data include BAROMETRIC PRESSURE,
    DISSOLVED OXYGEN, Partial pressure (or fugacity) of carbon dioxide, SALINITY and
    SEA SURFACE TEMPERATURE. The instruments used to collect these data include Bubble
    type equilibrator for autonomous carbon dioxide (CO2) measurement and Carbon dioxide
    (CO2) gas analyzer.nnThese data were collected by Nathalie Lefevre of Universite
    Pierre et Marie Curie; Institut Pierre Simon Laplace; Laboratoire D'Oceanographie
    et du Climat: Experimentations et Approches Numeriques as part of the Moorings_PIRATA6S10W
    data set. CDIAC assigned the following cruise ID(s) to this data set: PIRA20060608.nnThe
    Global CO2 Time-series and Moorings Project involves international groups from 18
    countries who have mounted sensors on moored buoys to provide high resolution time-series
    measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
    (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
    Ocean Carbon Coordination Project (IOCCP).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
